Gnarls Barkley is a grammy award winning American musical collaboration between multi-instrumentalist and producer Danger Mouse (Brian Burton) from New York, and rapper/vocalist Cee-Lo Green (Thomas Callaway), from Atlanta. Their first album, St. Elsewhere, was released in 2006; it and their first hit, &quot;Crazy&quot;, were major commercial successes, and were noted for their large sales by download. The duo released their second album, The Odd Couple, in March of 2008.

